const axios = require('axios')

const createReview = (reviewData) => {
    const reviewJSON = JSON.stringify(reviewData)
    return axios.post('/reviews',{
        reviewJSON
    }).then( res => {
        return res.data
    })

}

module.exports = { createReview }
